lue\r\n+        });\r\n+    }\r\n+    const handleNewProductPrice = (e)=\u003e{\r\n+        setNewProduct({\r\n+            ...newProduct,\r\n+            price:e.target.value\r\n+        });\r\n+    }\r\n+    \r\n+    \r\n+    \r\n+    \r\n+    return (\r\n+        \u003cdiv\u003e\r\n+         \r\n+            \u003cNavbar /\u003e\r\n+            \u003cdiv className=\"d-flex justify-content-center align-items-center vh-100 w-auto\"\u003e\r\n+                \u003cform\r\n+                    className=\"bg-light p-4 d-flex flex-column gap-4 w-50 h-50 rounded-75\"\r\n+                    onSubmit={handleAddProduct}\r\n+                \u003e\r\n+                    \u003cdiv className=\"form-group\"\u003e\r\n+                        \u003clabel htmlFor=\"productName\"\u003eProduct Name\u003c/label\u003e\r\n+                        \u003cinput\r\n+                            type=\"text\"\r\n+                            className=\"form-control\"\r\n+                            id=\"productName\"\r\n+                            placeholder=\"Product Name\"\r\n+                            required\r\n+                            value={newProduct.name}\r\n+                            onChange={handleNewProductName}\r\n+                        /\u003e\r\n+                    \u003c/div\u003e\r\n+                    \u003cdiv className=\"form-group\"\u003e\r\n+                        \u003clabel htmlFor=\"productPrice\"\u003ePrice\u003c/label\u003e\r\n+                        \u003cinput\r\n+                            type=\"number\"\r\n+                            className=\"form-control\"\r\n+                            id=\"productPrice\"\r\n+                            placeholder=\"Product price\"\r\n+                            min=\"0\"\r\n+                            required\r\n+                            value={newProduct.price}\r\n+                            onChange={handleNewProductPrice}\r\n+                        /\u003e\r\n+                    \u003