os.get(`/get/${id}`);\r\n+        return response.data;\r\n+    } catch (error) {\r\n+        \r\n+    }\r\n+}\r\n+\r\n+// update product by id\r\n+const updateProduct = async (updatedProduct,id)=\u003e{\r\n+    try {\r\n+        const response = await axios.put(`/update/${id}`,updatedProduct)\r\n+        return response;\r\n+    } catch (error) {\r\n+        console.log(error)\r\n+    }\r\n+}\r\n+\r\n+//delete product by id\r\n+const deleteProductRequest = async (id)=\u003e{\r\n+    try {\r\n+        const response = await axios.delete(`/delete/${id}`);\r\n+        return response;\r\n+    } catch (error) {\r\n+        console.error(error);\r\n+    }\r\n+}\r\n+\r\n+\r\n+\r\n+module.exports={addUser,getUser,fetchAllData,addProduct,updateProduct,getProductById,deleteProductRequest}\n\\ No newline at end of file\n","new_path":"src/app/api/api.js","old_path":"src/app/api/api.js","a_mode":"0","b_mode":"100755","new_file":true,"renamed_file":false,"deleted_file":false,"generated_file":null},{"diff":"@@ -0,0 +1,45 @@\n+import axios from \"axios\";\r\n+import NextAuthOptions from \"next-auth\";\r\n+import Credentials from \"next-auth/providers/credentials\";\r\n+import {getUser} from \"../../api\"\r\n+\r\n+/* import GithubProvider from \"next-auth/providers/github\";\r\n+ */module.exports = {\r\n+  providers: [\r\n+    /* GithubProvider({\r\n+        clientId:process.env.GITHUB_CLIENT_ID,\r\n+        clientSecret: process.env.GITHUB_SECRET\r\n+    }), */\r\n+    Credentials({\r\n+        name:\"credentials\",\r\n+        credentials:{\r\n+            username:{\r\n+                label:\"username\",\r\n+                type:\"text\",\r\n+                placeholder:\"username\"\r\n+            },\r\n+            password:{\r\n+                label:\"password\",\r\n+                type:\"password\",\r\n+                placeholder:\"password\"\r\n+            }\r\n+        },\r\n+        async authorize(credentials){\r\n+             const user = await getUser(credential