    try {\r\n+      const response = await deleteProductRequest(id);\r\n+      if (response.status) {\r\n+        await Swal.fire({\r\n+          icon: \"success\",\r\n+          title: \"The product has been deleted\",\r\n+          showConfirmButton: false,\r\n+          timer: 1500\r\n+        });\r\n+        setDeletedProduct(!deletedProduct);\r\n+      \r\n+      } else {\r\n+        console.log(\"Failed to delete\", response);\r\n+      }\r\n+    } catch (error) {\r\n+      console.error(\"Error deleting product:\", error);\r\n+    }\r\n+  } \r\n+\r\n+  //confirmation popup for deleting product\r\n+   function confirmationModal(id) {\r\n+    return Swal.fire({\r\n+      title: \"Would you like to remove the product?\",\r\n+      showCancelButton: true,\r\n+      confirmButtonText: \"Save\",\r\n+      denyButtonText: `Cancel`\r\n+    }).then((result) =\u003e {\r\n+      if (result.isConfirmed) {\r\n+        deleteProduct(id);\r\n+      }\r\n+    });\r\n+  }\r\n+\r\n+\r\n+  return (\r\n+    \u003cdiv className=\"d-flex flex-column gap-4\"\u003e\r\n+      \u003cNavbar /\u003e\r\n+     \r\n+\r\n+      {loading ? (\u003cLoading /\u003e) :\r\n+        !products.length ?\r\n+          \u003cdiv className=\"empty w-100 d-flex justify-content-center align-items-center display-5 bg-light text-center\"\u003eLooks like your inventory is empty. Time to stock up\u003c/div\u003e \r\n+          :(\r\n+            \u003cdiv\u003e\r\n+            \u003ctable className=\"table table-hover w-75 container-fluid\"\u003e\r\n+              \u003cthead\u003e\r\n+                \u003ctr\u003e\r\n+                  \u003cth scope=\"col\"\u003e# ID\u003c/th\u003e\r\n+                  \u003cth scope=\"col\"\u003e\u003cbutton className=\"border border-white bg-white fw-bold\" /* onClick={sortByName} */\u003eProduct Name {/* ({sortNameType}) */} \u003c/button\u003e\u003c/th\u003e\r\n+                  \u003cth scope=\"col\"\u003e\u003cbutton className=\"border border-white bg-white fw-bol