COLLECTION);\r\n+const userCollection = db.collection(process.env.DB_USER_COLLECTION);\r\n+\r\n+\r\n+\r\n+async function getUser(req,res,data){\r\n+    const userData = data;\r\n+    try {\r\n+        const user = await userCollection.findOne({username: userData.username,password:userData.password});\r\n+        if(user){\r\n+            return res.send(user);\r\n+        }else{\r\n+            return res.send({status:404,message:\"user not found\"});\r\n+        }\r\n+    } catch (error) {\r\n+        console.log(error);\r\n+    }\r\n+}\r\n+\r\n+async function addUser(req,res,data){\r\n+    try {\r\n+        const userData = data;\r\n+        /*check if username exist*/\r\n+            const result = await userCollection.insertOne(userData);\r\n+            if(result){\r\n+            return res.send({status:201,id:result.insertedId})\r\n+            }else{\r\n+                return res.send({status:405,message:\"failed to add user\"})\r\n+            }\r\n+        \r\n+        \r\n+    } catch (error) {\r\n+        fastify.log.error(error);\r\n+        res.status(500).send({ error: 'Failed to fetch products' });\r\n+    }\r\n+}\r\n+\r\n+\r\n+// add new product\r\n+async function addNewProduct(req,res,product){\r\n+const newProduct = product ;\r\n+         try {\r\n+            const result = await ProductsCollection.insertOne(newProduct);\r\n+            res.send(result);\r\n+        } catch (err) {\r\n+            fastify.log.error(err);\r\n+            res.status(500).send({ error: 'Failed to add product' });\r\n+        }\r\n+}\r\n+//get All Products\r\n+async function getProducts(req,res){\r\n+    try {\r\n+\r\n+        const products = await ProductsCollection.find({}).toArray();\r\n+        if(products.length !== 0){\r\n+           return res.send(products);\r\n+        }else{\r\n+            return res.send({status:false,message:\"there is no products\"})\r\n+        }\r\n+    } catch (error) {\r\n+        fastify.log.error(error);\r\n+        res.status(500).send({ error: 'Failed to fetch products' });\r\n+    }\r\n+}\r\n+\r\n+\r\n+\r\n+//get Product by ID\r\n+async function getProductById(req,res){\r\n+    const { id } = req.params;\r\n+    const objectID = new ObjectId(id);\r\n+    try {\r\n+        const product = await ProductsCollection.findOne({ _id:objectID });\r\n+        if (product) {\r\n+            return res.send(product);\r\n+        } else {\r\n+            res.send({ status: false, message: \"No data found\" });\r\n+        }\r\n+    } catch (err) {\r\n+        fastify.log.error(err);\r\n+        res.send({ status: 500, message: \"server error\" });\r\n+    }\r\n+}    \r\n+\r\n+//update product by ID\r\n+async function updateProduct(req,res,product){\r\n+    const { id } = req.params;\r\n+    const objectID = new ObjectId(id);\r\n+    const updatedproduct = product ;\r\n+\r\n+    try {\r\n+        const product = await ProductsCollection.findOne({ _id: objectID });\r\n+        if (product) {\r\n+          \r\n+            await ProductsCollection.updateOne({ _id: objectID },{\r\n+                $set:{\r\n+                    name:updatedproduct.name,\r\n+                    price:updatedproduct.price\r\n+                },\r\n+                $currentDate: { lastUpdated: true }\r\n+            });\r\n+            return res.send({ status: true, message: \"Product updated successfully\" });\r\n+        } else {\r\n+            return res.send({ status: false, message: \"Product not found\" });\r\n+        }\r\n+    } catch (error) {\r\n+        fastify.log.error(error);\r\n+        res.send({ status: 500, message: \"Server error\" });\r\n+    }\r\n+}      \r\n+\r\n+//delete product by ID\r\n+async function deleteProduct(req,res){\r\n+    const { id } = req.params;\r\n+    const objectID = new ObjectId(id);\r\n+    try {\r\n+        const result = await ProductsCollection.deleteOne({ _id:objectID })\r\n+        if (result.deletedCount \u003e 0) {\r\n+            return res.send({ status: true, message: \"Product deleted successfully\" });\r\n+        } else {\r\n+            return res.send({ status: 404, message: \"Product not found\" });\r\n+        }\r\n+    } catch (error) {\r\n+        fastify.log.error(error);\r\n+        res.send({ status: 500, message: \"Failed to delete product\" });\r\n+    }\r\n+}\r\n+ \r\n+\r\n+\r\n+module.exports = {\r\n+    getUser,\r\n+    addUser,\r\n+    getProducts,\r\n+    getProductById,\r\n+    addNewProduct,\r\n+    updateProduct,\r\n+    deleteProduct\r\n+\r\n+};\r\n","new_path":"src/controllers/productsController.js","old_path":"src/controllers/productsController.js","a_mode":"0","b_mode":"100755","new_file":true,"renamed_file":false,"deleted_file":false,"generated_file":null},{"diff":"@@ -0,0 +1,19 @@\n+//connect to mongoDB database\r\n+require('dotenv').config();\r\n+\r\n+const { MongoClient } = require('mongodb');\r\n+\r\n+const uri = process.env.DB_URI;\r\n+const client = new MongoClient(uri);\r\n+\r\n+//connect to MongoDB\r\n+async function connectMongo() {\r\n+  try {\r\n+    await client.connect();\r\n+    console.log('Connected to MongoDB');\r\n+  } catch (err) {\r\n+    console.log(err);\r\n+  }\r\n+}\r\n+\r\n+module.exports = connectMongo;\n\\ No newline at end of file\n","new_path":"src/lib/connectDB.js","old_path":"src/lib/connectDB.js","a_mode":"0","b_mode":"100755","new_file":true,"renamed_file":false,"deleted_file":false,"generated_file":null},{"diff":"@@ -0,0 +1,53 @@\n+//routes send api requests\r\n+const {getUser,addUser, getProducts,getProductById,addNewProduct,updateProduct,deleteProduct} = require('../controllers/productsController');\r\n+\r\n+//importing Schemas\r\n+const getproductSchema = require('../schema/getProducts');\r\n+const productSchema = require('../schema/addProduct');\r\n+const getOneProductSchema = require('../schema/getProduct');\r\n+const updateProductSchema = require('../schema/updateProduct');\r\n+const deleteProductSchema = require('../schema/deleteProduct');\r\n+\r\n+async functi